import React from "react";
import "./ExpenseItem.css";

const ExpenceItem = () => {
  return (
    <div className="expense-item">
      <div>March 26th 2022</div>
      <div className="expense-item__description">
        <h2>Car Insurance</h2>
        <div>$950.40</div>
      </div>
    </div>
  );
};

export default ExpenceItem;
